import "core-js/modules/es.array.push.js";
import axios from "axios";
export default {
  name: "AllTags",
  data() {
    return {
      tags: []
    };
  },
  async mounted() {
    await this.fetchTags();
  },
  methods: {
    async fetchTags() {
      await axios.get('http://localhost:9090/specialitylookup-all').then(response => this.tags = this.splitToChunks(response.data, 2));
    },
    splitToChunks(array, parts) {
      let result = [];
      for (let i = parts; i > 0; i--) {
        result.push(array.splice(0, Math.ceil(array.length / i)));
      }
      return result;
    }
  }
};
